Voting Unit (Unit A):
Included: All full-time and regular part-time Art Therapists, Certified Therapeutic Recreation Specialists, Clinical Treatment Coordinators, Licensed Psychotherapist Programmatic Care employees, Music Therapists, Occupational Therapists, and Psychotherapist Trainees employed by the Employer at its acute care hospital located at 2450 Riverside Avenue, Minneapolis, MN, within an inpatient behavioral health unit;

Excluded: Chaplains and Associate Chaplains, employees working within or at Lodging Plus, employees working within or at Adult and Adolescent Evaluation Center a/k/a Fairview Assessment Center (FAC), all other professional employees, technical employees, managerial employees, guards and supervisors as defined by the Act, employees already represented by the Petitioner, and all other employees.

If a majority of valid ballots are cast for SEIU Healthcare Minnesota and Iowa, they will be taken to have indicated the employees' desire to be included in the existing bargaining unit of pharmacists already represented by SEIU Healthcare Minnesota and Iowa at the Employer's Minneapolis, Minnesota facility.  If a majority of the valid ballots are not cast for representation, they will be taken to have indicated the employees' desire to remain unrepresented.
